import { Col, Container, Row } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";

const UserPage = () => {
  return (
    <Container>
      <Row>
        <div>
          <span>Homepage</span>
          <Icon.CaretRightFill size={10} />
          <span>user</span>
          <Icon.CaretRightFill />
          <span>Name Surname</span>
        </div>
        <Col></Col>
        <Col></Col>
      </Row>
    </Container>
  );
};
export default UserPage;
